h stainless steel spokes; built for speed.','9728BB39-E515-47D8-BF9B-A3C8C2129E45','2007-06-01 00:00:00'),(872,'Strong rear wheel with double-walled rim.','834081BE-158F-41A6-8D0C-1E7B4D3ABBA3','2007-06-01 00:00:00'),(873,'Excellent aerodynamic rims guarantee a smooth ride.','E055EFC7-5F01-4D4D-B024-33AB5B6C6AD1','2007-06-01 00:00:00'),(885,'Synthetic leather. Features gel for increased comfort.','FB8C8ABB-4A51-4852-A870-6047B8834D22','2007-06-01 00:00:00'),(886,'Designed to absorb shock.','F016E3D7-6177-43A3-8BFF-160320966471','2008-03-11 10:32:17'),(887,'Anatomic design for a full-day of riding in comfort. Durable leather.','BAF38C0E-69BF-4F6C-805A-C7C1C6E9056A','2007-06-01 00:00:00'),(888,'Lightweight foam-padded saddle.','76153F63-2A1C-4EE6-BBCF-0585D8AC8C55','2007-06-01 00:00:00'),(889,'Rubber bumpers absorb bumps.','289FB4CA-B70A-458E-AAFB-D13CB073058C','2007-06-01 00:00:00'),(890,'Lightweight kevlar racing saddle. Leather.','DEE34939-FC85-401A-930B-75EBEBF7FFE1','2007-06-01 00:00:00'),(891,'Comfortable, ergonomically shaped gel saddle.','DD890D9D-0143-4476-B489-86D8D6094AA4','2007-06-01 00:00:00'),(892,'New design relieves pressure for long rides.','3410C26D-01A6-416F-898A-43228FA1FAD6','2007-06-01 00:00:00'),(893,'Cut-out shell for a more comfortable ride.','19DA3868-1559-462F-8098-00BE37BDBEDC','2007-06-01 00:00:00'),(903,'Comparible traction, less expensive wire bead casing.','B83BE4A3-A95B-4D96-81DE-16325F0DF11E','2007-06-01 00:00:00'),(904,'Great traction, high-density rubber.','E917F093-2A28-496B-AEBF-A704CD738038','2007-06-01 00:00:00'),(905,'Incredible traction, lightweight carbon reinforced.','1153E56D-B9E1-458E-A2BB-D6D6362C5B05','2007-06-01 00:00:00'),(906,'Same great treads as more expensive tire with a less expensive wire bead casing.','2E1975DE-21B8-4EC9-9998-6F39E14D476C','2007-06-01 00:00:00'),(907,'Higher density rubber.','DCBC8264-C4D7-4B04-9531-92AB4C868C10','2007-06-01 00:00:00'),(908,'Lightweight carbon reinforced  for an unrivaled ride a